  false,\n\t\"url\": null,\n\t\"notes\": \"Commercial and Industrial Network information
  for the centerline road segments in the State of Iowa.rnrn1. Purpose.  It is the
  purpose of this section to enhance opportunities for the development and diversification
  of the stateu2019s economy through the identification and improvement of a network
  of commercial and industrial highways.  The network shall consist of interconnected
  routes which provide long distance route continuity.  The purpose of this highway
  network shall be to improve the flow of commerce; to make travel more convenient,
  safe, and efficient; and to better connect Iowa with regional, national, and international
  markets.  The commission shall concentrate a major portion of its annual construction
  budget on this network of commercial and industrial highways.  In order to ensure
  the greatest possible availability of funds for the improvement of the network,
  primary highway funds shall not be spent beyond continuing maintenance for improvements
  to route segments that will be bypassed by the relocation of portions of the commercial
  and industrial highway network.rntrn2. Network selection.rna. The commission shall
  identify, within the primary road system, a network of commercial and industrial
  highways.  The commission shall consider all of the following factors in the identification
  of this network:rnrni. The connection by the most direct routes feasible of major
  urban areas and regions of the state to each other and to the national system of
  interstate and defense highways and priority routes in adjacent states.rnii. The
  existence of high volumes of total traffic and commercial traffic.rniii. Long distance
  traffic movements.rniv. Area coverage and balance of spacing with service to major
  growth centers within the state.rnv. Metropolitan area bypasses consistent with
  metropolitan or regional area plans established through cooperation by the department
  and local officials.rnrnb. The network of commercial and industrial highways shall
  not exceed two thousand  six hundred miles including municipal extensions of these
  highways.rntrn3. Standards.  The department shall establish standards pertaining
  to the specific location, design, and access control for each segment of the commercial
  and industrial highways.rntrn4. Network development.  In establishing priorities
  for improvement projects, the department shall take into consideration the following
  additional criteria:  urban area bypasses that improve urban or regional accessibility
  or improve corridor travel; projects consistent with regional or metropolitan transportation
  plans established through cooperation by the department and local officials; and
  the willingness of local officials to provide financial or other assistance for
  the development of projects.rnrn Source: Iowa Code Section 313.2A Primary Roads:
  Commercial and Industrial Highways. http://search.legis.state.ia.us/nxt/gateway.dll/ic/1/13/10856/10857/11188/11191?f=templates&fn=default.htm.\",\n\t\"license_title\":
